import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { FaPhone, FaWeixin, FaTruck, FaGift } from 'react-icons/fa';
import OrderModal from './OrderModal';

const Pricing: React.FC = () => {
  const { ref, inView } = useInView({
    triggerOnce: true,
    threshold: 0.2
  });

  const [isModalOpen, setIsModalOpen] = useState(false);

  const handleOrderClick = () => {
    // ÂÖàÊâìÂºÄÈ£û‰π¶Ë°®Âçï
    window.open('https://icnx5ms2v0zo.feishu.cn/share/base/form/shrcnk5ySb2CAhLdgN3rRB9XCKj', '_blank');
    // ÁÑ∂ÂêéÊòæÁ§∫ÂºπÁ™ó
    setIsModalOpen(true);
  };

  const packages = [
    {
      name: 'Â∞ùÈ≤úË£Ö',
      weight: '5Êñ§',
      price: '59',
      originalPrice: '79',
      features: ['Á≤æÈÄâÂ§ßÊûú', 'Áé∞Ë¥ßÁßíÂèë', 'Á†¥ÊçüÂåÖËµî', 'Á≤æÁæéÂåÖË£Ö'],
      popular: true,
      image: '/images/9.jpg'
    },
    {
      name: 'ÂÆ∂Â∫≠Ë£Ö',
      weight: '10Êñ§',
      price: '99',
      originalPrice: '109',
      features: ['ÁâπÁ∫ßÂ§ßÊûú', 'Áé∞Ë¥ßÁßíÂèë', 'Á†¥ÊçüÂåÖËµî', 'Á≤æÁæéÂåÖË£Ö'],
      popular: false,
      image: '/images/9.jpg'
    }
  ];

  return (
    <section className="pricing-section" ref={ref}>
      <motion.div 
        className="container"
        initial={{ opacity: 0 }}
        animate={inView ? { opacity: 1 } : {}}
        transition={{ duration: 0.8 }}
      >
        <motion.h2 
          className="section-title"
          initial={{ y: 30, opacity: 0 }}
          animate={inView ? { y: 0, opacity: 1 } : {}}
          transition={{ delay: 0.2, duration: 0.8 }}
        >
          Êñ∞È≤úÁõ¥Ëææ
        </motion.h2>

        <div className="pricing-cards">
          {packages.map((pkg, index) => (
            <motion.div 
              key={index}
              className={`price-card ${pkg.popular ? 'popular' : ''}`}
              initial={{ y: 50, opacity: 0 }}
              animate={inView ? { y: 0, opacity: 1 } : {}}
              transition={{ delay: 0.3 + index * 0.1, duration: 0.8 }}
              whileHover={{ y: -10 }}
            >
              {pkg.popular && <div className="popular-badge">ÁÉ≠ÈîÄ</div>}
              <h3>{pkg.name}</h3>
              <div className="package-image">
                <img src={pkg.image} alt={pkg.name} />
              </div>
              <div className="weight">{pkg.weight}</div>
              <div className="price-info">
                <span className="currency">¬•</span>
                <span className="price">{pkg.price}</span>
                {pkg.originalPrice && (
                  <span className="original-price">¬•{pkg.originalPrice}</span>
                )}
              </div>
              <ul className="features">
                {pkg.features.map((feature, idx) => (
                  <li key={idx}>
                    <span className="check">‚úì</span>
                    {feature}
                  </li>
                ))}
              </ul>
              <motion.button 
                className="order-btn"
                onClick={handleOrderClick}
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.95 }}
              >
                üìù Á´ãÂç≥ËÆ¢Ë¥≠
              </motion.button>
            </motion.div>
          ))}
        </div>

        <motion.div 
          className="order-process"
          initial={{ y: 30, opacity: 0 }}
          animate={inView ? { y: 0, opacity: 1 } : {}}
          transition={{ delay: 0.6, duration: 0.8 }}
        >
          <h3>‰∏ãÂçïÊµÅÁ®ã</h3>
          <div className="process-steps">
            <div className="step">
              <div className="step-number">1</div>
              <div className="step-content">
                <h4>Â°´ÂÜôËÆ¢Âçï</h4>
                <p>ÁÇπÂáª"Á´ãÂç≥ËÆ¢Ë¥≠"Â°´ÂÜôÊî∂Ë¥ß‰ø°ÊÅØ</p>
              </div>
            </div>
            <div className="step">
              <div className="step-number">2</div>
              <div className="step-content">
                <h4>ÂæÆ‰ø°‰ªòÊ¨æ</h4>
                <p>Êâ´Á†Å‰ªòÊ¨æÂπ∂<b style={{color: 'red'}}>Â§áÊ≥®ËÆ¢ÂçïÂè∑</b></p>
              </div>
            </div>
            <div className="step">
              <div className="step-number">3</div>
              <div className="step-content">
                <h4>Á°ÆËÆ§ÂèëË¥ß</h4>
                <p>Êî∂Âà∞‰ªòÊ¨æÂêé24Â∞èÊó∂ÂÜÖÂèëË¥ß</p>
              </div>
            </div>
          </div>
        </motion.div>



        <motion.div 
          className="contact-section"
          initial={{ y: 30, opacity: 0 }}
          animate={inView ? { y: 0, opacity: 1 } : {}}
          transition={{ delay: 0.8, duration: 0.8 }}
        >
          <div className="contact-methods">
            <motion.div 
              className="contact-item"
              whileHover={{ scale: 1.05 }}
            >
              <FaPhone className="contact-icon" size={32} />
              <div className="contact-info">
                <p>ÁîµËØùËÆ¢Ë¥≠</p>
                <p className="contact-detail">138-8888-8888</p>
              </div>
            </motion.div>
            <motion.div 
              className="contact-item"
              whileHover={{ scale: 1.05 }}
            >
              <FaWeixin className="contact-icon" size={32} />
